import './Header.css'

function Header() {
    const styles = {
    paperContainer: {
        height: 136,
        backgroundImage: `url(${""})`,
        backgroundRepeat  : 'no-repeat',
        backgroundPosition: 'center',
    }
};
    return (
        <div class="ui segment">
             <header style={styles.paperContainer}>
       <h1 class="ui center aligned header">Star Wars</h1>
        <img src = "https://www.animatedimages.org/data/media/635/animated-star-trek-image-0018.gif" alt="Star Wars"/>   
      </header>
        </div>
    )
}

export default Header
